import React from 'react'
import Wave from 'react-wavify'

class ShowDays extends React.Component{
    render(){
        return(
            <>
            <div style={{width: '250px', height: '250px',borderRadius: '50%',background: '#e69915',position:'relative',zIndex:0}}>
                <div style={{width: '230px', height: '230px',borderRadius: '50%',background: '#ffffff',position:'absolute',top:'10px',left:'10px',zIndex:-1}}></div>
                <Wave style= {{height: '100%'}}fill="#e69915" mask="url(#mask)" options={{ height:150,points: 4, speed: 1, amplitude: 7 }}>
                {/* Example adapted from https://developer.mozilla.org/en-US/docs/Web/SVG/Element/mask */}
                <mask id="mask">
                    <path d="M0,125 A20,20,0,0,1,250,125
                             M0,125 A20,20,0,0,0,250,125 z" fill="white" />
                </mask>
                </Wave>
            </div>
            </>
        )
    }
}

export default ShowDays;
